{**
			use types ErrorLibrary;
			use behavior Extended_ErrorLibrary::Display_States;
			
			error propagations
				DP_ASL1_Conn: in propagation {ValueError};
				AttitudeData1_In: in propagation {ValueError};
				AttitudeDisplay_Out: out propagation {ValueError};
				RadAltData_In: in propagation {ValueError};
				RadAltDisplay_Out: out propagation {ValueError};
				BaroAltData_In: in propagation {ValueError};
				BaroAltDisplay_Out: out propagation {ValueError};
			end propagations;
	
			component error behavior
				events
					UndetectableError: error event;
					ComparatorFails: error event;
				transitions
					t1: Operational -[1 ormore (UndetectableError, (ComparatorFails and (1 ormore (DP_ASL1_Conn, AttitudeData1_In))))]-> MisleadingAttitudeDisplay;
					t2: Operational -[1 ormore (UndetectableError, (ComparatorFails and (1 ormore (DP_ASL1_Conn, RadAltData_In))))]-> MisleadingRadAltDisplay;
					t3: Operational -[1 ormore (UndetectableError,(ComparatorFails and (1 ormore (DP_ASL1_Conn, BaroAltData_In))))]-> MisleadingBaroAltDisplay;
			end component;
						
			properties
				EMV2::OccurrenceDistribution => [ ProbabilityValue => 1.85e-6 ; Distribution => Poisson;] applies to UndetectableError;
				EMV2::OccurrenceDistribution => [ ProbabilityValue => 1.18e-6 ; Distribution => Poisson;] applies to ComparatorFails;
				EMV2::OccurrenceDistribution => [ ProbabilityValue => 2.60e-10 ; Distribution => Poisson;] applies to DP_ASL1_Conn;
		**}

{**
error types 
----Fault Code
FaultCode: type;
UnknowBlankedFaultCode: type extends FaultCode;

--Detectable graphic faults
HardweareGraphicFault: type extends FaultCode;

--Detectable LCD faults
LuminanceFallsBelowThresholdFault: type extends FaultCode;
HardwearLcdFault: type extends FaultCode;
LCDFaults: type set {LuminanceFallsBelowThresholdFault, HardwearLcdFault};

--Power supply faults
FanFailedFault: type extends FaultCode;
OverHeatFault: type extends FaultCode;
PowerFaults: type set {FanFailedFault, OverHeatFault};

--MFD software faults
MfdSoftwareFormatFault: type extends FaultCode;
MfdSoftwareGraphicServiceFault: type extends FaultCode;
MfdSoftwareFaults: type set {MfdSoftwareFormatFault, MfdSoftwareGraphicServiceFault};
 
end types;

error behavior Display_ThreeStates
	use types ErrorLibrary;
	states
		Operational: initial state;
		MisleadingDisplay: state;
		OmissionDisplay: state{FaultCode};
end behavior;

error behavior Display_AttitudeStates
	use types Extended_ErrorLibrary;
	states
		Operational: initial state;
		MisleadingDisplay: state;
		LossPrimaryPFDAttitudeDisp: state;
		LossAllPFD: state;
end behavior;

error behavior Display_States
	use types Extended_ErrorLibrary;
	states
		Operational: initial state;
		MisleadingAttitudeDisplay: state;
		MisleadingRadAltDisplay: state;
		MisleadingBaroAltDisplay: state;
		MisleadingHeadingDisplay: state;
		LossAllDisplays: state;
end behavior;
	
**}

