{**
			--Top level functional/fault hazards
			use types ErrorLibrary;
			use behavior Extended_ErrorLibrary::Display_ThreeStates;
			error propagations 
				EGI_Source: out propagation {ValueError, ServiceOmission, ItemOmission};
--			flows
--				f_egi1_source: error source EGI_Source;
			end propagations;
			
			component error behavior
			events
				loss_bus_access: error event;
				generate_value_error: error event;
			transitions
				t11: Operational -[generate_value_error]-> MisleadingDisplay;
--				t21: Operational -[loss_bus_access]-> OmissionDisplay;
			propagations
				p1: MisleadingDisplay -[generate_value_error]-> EGI_Source{ValueError};
				p2: OmissionDisplay -[loss_bus_access]-> EGI_Source{ServiceOmission};
			end component;			
			properties

			EMV2::hazards =>
			([	crossreference => \"31.60.10\";
				failure => \"Misleading Display Of Pitch or Roll Data On PFD to both pilots simultaneously\";
				phases => (\"all flight modes in IMC or DVE\");
				severity => MILSTD882::Catastrophic;
				likelihood => MILSTD882::Improbable;
				description => \"Undetected/Unannunciated Display of Hazardously Misleading Attitude simultaneously on both sides of cockpit\";
				comment => \"not Catastrophic if detected/annunciated\";
				])
				applies to MisleadingDisplay;
								
			EMV2::hazards =>
			([	crossreference => \"34.20.05\";
				failure => \"Loss of Primary Attitude Indication\";
				phases => (\"all flight modes in IMC or DVE\");
				severity => MILSTD882::Marginal;
				likelihood => MILSTD882::Remote;
				description => \"Loss of Attitude on a all primary attitude displays\";
				comment => \"\";
				])
				applies to loss_bus_access, generate_value_error;
				
			EMV2::OccurrenceDistribution =>  [ ProbabilityValue => 1.0e-6 ; Distribution => Poisson;] applies to loss_bus_access, generate_value_error, MisleadingDisplay, OmissionDisplay;				
		**}
